import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Dashboard.css'; // Ensure your CSS file is updated with the styles below
import logo from '.\public\logo1.png'; // Replace './logo.png' with the path to your logo

const Dashboard = () => {
  const navigate = useNavigate();

  // Dummy user details
  const user = {
    name: 'John Doe',
    role: 'Member',
    email: 'johndoe@example.com',
  };

  // Handle button clicks to navigate to the appropriate page
  const handleViewClubs = () => {
    navigate('/clubs');
  }
  const handleViewEvents = () => {
    navigate('/events');
  };

  const handleViewResources = () => {
    navigate('/resources');
  };

  // Navigate to delete account page
  const handleDeleteAccount = () => {
    navigate('/delete-account');
  };

  // Navigate to logout page
  const handleLogout = () => {
    navigate('/logout');
  };

  return (
    <div className="dashboard-container">
      {/* Top Navigation Bar */}
      <div className="top-nav">
        {/* Logo */}
        <div className="logo">
          <img src={logo} alt="Logo" />
        </div>

        {/* Profile Section */}
        <div className="profile-section">
          <div className="profile-dropdown">
            <span className="profile-name">{user.name}</span>
            <div className="dropdown-content">
              <p><strong>Name:</strong> {user.name}</p>
              <p><strong>Role:</strong> {user.role}</p>
              <p><strong>Email:</strong> {user.email}</p>
              <button className="btn btn-warning" onClick={handleLogout}>
                Logout
              </button>
              <button className="btn btn-danger" onClick={handleDeleteAccount}>
                Delete Account
              </button>
            </div>
          </div>
        </div>
      </div>

      {/* Main Content */}
      <h1 className="dashboard-title">Welcome to the digital frontier – it’s time to explore</h1>

      <div className="button-group">
        <div className="card">
          <button className="btn btn-primary" onClick={handleViewClubs}>
            View All Clubs
          </button>
        </div>
        <div className="card">
          <button className="btn btn-secondary" onClick={handleViewEvents}>
            View All Events
          </button>
        </div>
        <div className="card">
          <button className="btn btn-success" onClick={handleViewResources}>
            View All Resources
          </button>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
